\b0 To support the ability to quickly delete messages and threads, we have added "Delete" links next to each thread and message, which when clicked will not display a delete confirmation message, but will instead immediately delete the thread/message and then provide the instructor with an opportunity to restore the thread/message. \ \ The usability team recommends that we do not allow a user to delete the parent message without also deleting the associated child messages, so that is why the only action that may be taken on a parent message is to delete the entire thread. The usability team's review of the requirements for this functionality is included in this design as Appendix A.\ \ - If an instructor clicks the "Delete Thread" link, next to a parent message, the system will delete the parent message and any associated child messages, using a Fade Out transition ({\field{\*\fldinst{HYPERLINK "http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadeout"}}{\fldrslt http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadeout}}). Then the system will replace the subject of the thread with "Deleted by <Name of User who Deleted Thread>" as shown in the ITV: Show Deleted Thread screen (SDT-1), using a Fade In transition ({\field{\*\fldinst{HYPERLINK "http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadein"}}{\fldrslt http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadein}}).\ - If an instructor clicks the "Delete" link, next to a child message, the system will delete the message, using a Fade Out transition ({\field{\*\fldinst{HYPERLINK "http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadeout"}}{\fldrslt http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadeout}}). Then the system will replace the subject of the message with "Deleted by <Name of User who Deleted Message>" as shown in the ITV: Show Deleted Message screen (SDM-1), using a Fade In transition ({\field{\*\fldinst{HYPERLINK "http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadein"}}{\fldrslt http://developer.yahoo.com/ypatterns/pattern.php?pattern=fadein}}).}

