\f0\b\fs24 \cf0 Notes\ \
\b0 To support the ability to quickly delete messages and threads, we have added "Delete" links for each message, which when clicked will not display a delete confirmation message, but will instead immediately delete the thread/message and then provide the instructor with an opportunity to restore the thread/message. \ \ The usability team recommends that we do not allow a user to delete the parent message without also deleting the associated child messages, so that is why the only action that may be taken on a parent message is to delete the entire thread. The usability team's review of the requirements for this functionality is included in this design as Appendix A.\ \ - If a message is the parent message of a thread, the system will display a "Delete Thread" link.\ - If an instructor clicks the "Delete Thread" link, the system will delete the parent message and any associated child messages and return the instructor to the screen from which he accessed this message, either ITV: Show Deleted Thread (ITV2-1) or DET: Show Deleted Thread (DET2-1).\ - If a message is a child of a thread, the system will display a "Delete" link.\ - If an instructor clicks the "Delete" link, the system will delete the message and return the instructor to the screen from which he accessed this message, either ITV: Show Deleted Message (ITV2-2) or DET: Show Deleted Message (DET2-2).}

